import React from 'react';
import './App.css';
import Footer from './components/Footer';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import UploadPage from './pages/UploadPage';
import ImagesPage from './pages/ImagesPage';
import ImagesAnnotationPage from './pages/ImagesAnnotationPage';
import Nopage from './pages/Nopage';

function App() {
  return (
    <Router>
      <h1>Image Annotation and Measurement Application</h1>
      <nav className="nav-container">
        <div className="nav-links">
          <Link to="/images/upload" className="nav-link">Upload Images</Link>
          <Link to="/images/view" className="nav-link">Image Page</Link>
          <Link to="/images/edit/:id" className="nav-link">Image Annotation Page</Link>
        </div>
      </nav>
      <Routes>
        <Route path="/" element={<UploadPage />} />
        <Route path="/images/upload" element={<UploadPage />} />
        <Route path="/images/view" element={<ImagesPage />} />
        <Route path="/images/edit/:id" element={<ImagesAnnotationPage />} />
        <Route path="*" element={<Nopage />} />
      </Routes>

      <div>
        <Footer className="footer" />
      </div>

    </Router>
  );
}

export default App;
